import React from "react";
import Background from "./img/1489353.jpg";

var sectionStyle = {
    height: "100%",
    backgroundImage: "url(" + { Background } + ")"
  };

export default function Login()
{
    return <div class="container-fluid row col-12 login" style={sectionStyle}>
     
    </div>
}
